import './styles/App.css';
import './styles/parallax.css';
import './styles/lens-flare.css';

function App() {

	return (
    <div class="main">
      <div class="parallax">
        <div class="parallax-group">
          <div class="parallax-layer parallax-layer--back">
            <img class="background" src="./media/background3.png"/>
          </div>
          {/* <div class="parallax-layer parallax-layer--back"> */}
            <div class="lensflare">
              <div class="source-spread"></div>
              <div class="source"></div>
              <div class="source-beam"></div>
              {/* <div class="c1"></div> */}
              {/* <div class="c2"></div> */}
              <div class="c3"></div>
              <div class="c4"></div>
              <div class="c5"></div>
            </div>
          {/* </div> */}
          <div class="parallax-layer parallax-layer--base">

          </div>
        </div>
      </div>
    </div>
	);
}

export default App;
